import React from 'react';
import { Container } from './styles';

const SixthSection: React.FC = () => {
  return (
    <Container>
      <div className="contact">
        <h5>Contato</h5>
        <h4></h4>
      </div>
      <div className="form"></div>
    </Container>
  );
};

export default SixthSection;
